import styled from "styled-components";
import TextoDestacado from "../TextoDestacado";
import Texto from "../Texto";
import Walee from "../../images/walle.png";
import PlaceHolder from "../../images/place_holder.png"

const ContainerApresentacao = styled.div`
    width: 100vw;
    height: 100vh;
`;

const WaleeImg = styled.img`

    display: flex;
    padding: 0 150px;
    margin-left: auto;

`;

const Deladin = styled.div`

    display: flex;
    unicode-bidi: isolate;
    flex-direction: row;

`;

const IntroImg = styled.img`

    display: flex;
    padding: 0 130px;
    margin-right: 0px;
    margin-top: 50px;
    width: 724px;
    height: 599px;

`;

const TextoDiv = styled.div`

    display: flex;
    padding: 0 250px;
    margin-left: auto;
    margin-right: 0px;
    margin-top: 20px;


`;

function Apresentacao() {
    return (
        <ContainerApresentacao>
            <WaleeImg src={Walee} alt="Walee" />
            <Deladin>
                <IntroImg src={PlaceHolder} alt="Place-Holder"/>
                <TextoDiv>
                    <TextoDestacado>TESTE</TextoDestacado>
                </TextoDiv>
            </Deladin>

        </ContainerApresentacao>
    );
}

export default Apresentacao;
